        async clacRequirementSpentTime(requirement) {
            let requirementLevel
            for (let j in requirement.customFields) {
                if (requirement.customFields[j].fieldIdentifier === '3324f5ce04bf47899a2230c8c9') {
                    requirementLevel = requirement.customFields[j].value
                }
            }
            const taskList = await this.getRelationTask(requirement.identifier)
            let spentTime = 0
            for (const task of taskList) {
                let difficulty = 1
                for (let j in task.fieldValueVOList) {
                    const difficultyField = this.getWorkitemDifficultyField(task.workitemTypeIdentifier)
                    if (task.fieldValueVOList[j].fieldIdentifier === difficultyField) {
                        difficulty = task.fieldValueVOList[j].value
                    }
                }
                const timeEstimate = this.clacSpentTime(task.workitemTypeIdentifier, requirementLevel, difficulty)
                if (timeEstimate) {
                    this.appendTaskProgress(task.subject + ': ' + timeEstimate.spentTime)
                    spentTime += await this.updateWorkitemSpentTime(task.identifier, timeEstimate.spentTime, task.assignToUser.identifier, timeEstimate.type)
                } else {
                    this.appendTaskProgress(task.subject + ': 未匹配到计算规则，跳过')
                }
            }
        }

        async clacWorkitemSpentTime(workitem) {
            this.appendTaskProgress('重新计算工时')
            let requirementLevel
            let requirement = await this.getWorkitem(workitem.parentIdentifier)
            if (!requirement) {
                requirement = workitem
            }
            for (let j in requirement.customFields) {
                if (requirement.customFields[j].fieldIdentifier === '3324f5ce04bf47899a2230c8c9') {
                    requirementLevel = requirement.customFields[j].value
                }
            }
            let difficulty = 1
            for (let j in workitem.customFields) {
                const difficultyField = this.getWorkitemDifficultyField(workitem.workitemType.identifier)
                if (workitem.customFields[j].fieldIdentifier === difficultyField) {
                    difficulty = workitem.customFields[j].value
                }
            }
            const timeEstimate = this.clacSpentTime(workitem.workitemType.identifier, requirementLevel, difficulty)
            if (timeEstimate) {
                this.appendTaskProgress('更新工时为: ' + timeEstimate.spentTime)
                await this.updateWorkitemSpentTime(workitem.identifier, timeEstimate.spentTime, workitem.assignedTo.identifier, timeEstimate.type)
            } else {
                this.appendTaskProgress('未匹配到计算规则')
            }
            location.reload()
        }

        clacSpentTime(workitemType, requirementLevel, difficulty) {
            const workitemTimeEstimateMap = {
                'ba102e46bc6a8483d9b7f25c': {
                    type: 'develop',
                    rule: {'1.5级': 8, '2级': 8, '2.5级': 8, '3级': 4}
                }, //研发 web,php
                '6da89f380532e4150d86c0fa20': {
                    type: 'test',
                    rule: {'1.5级': 8, '2级': 4, '2.5级': 2, '3级': 1}
                }, //测试 test
                '947683bf07275cddf056e9ba89': {
                    type: 'design',
                    rule: {'1.5级': 8, '2级': 4, '2.5级': 2, '3级': 1}
                }, //设计 plan
                '3e016c7251aa4ba67e7ce16d58': {
                    type: 'others',
                    rule: {'1.5级': 8, '2级': 4, '2.5级': 2, '3级': 1}
                } //其他 check
            }
            if (typeof workitemTimeEstimateMap[workitemType] == 'undefined') {
                return false
            }
            const workitemTimeEstimate = workitemTimeEstimateMap[workitemType]
            if (typeof workitemTimeEstimate.rule[requirementLevel] != 'undefined') {
                return {
                    spentTime: workitemTimeEstimate.rule[requirementLevel] * difficulty,
                    type: workitemTimeEstimate.type
                }
            }
            return false
        }

        async updateWorkitemSpentTime(identifier, spentTime, user, type = 'others', isAdd = false) {
            if (!spentTime) {
                return 0
            }
            let currentSpentTime = 0
            if (!isAdd) {
                const estimateList = await main.tool.requestGet('https://devops.aliyun.com/projex/api/workitem/workitem/time/estimate/list?workitemIdentifier='+identifier+'&_input_charset=utf-8')
                for (const estimate of estimateList) {
                    if (!estimate.description) {
                        await main.tool.request('https://devops.aliyun.com/projex/api/workitem/workitem/time/estimate/'+estimate.workitemIdentifier+'/'+estimate.identifier+'?_input_charset=utf-8', {}, 'DELETE')
                    } else {
                        currentSpentTime += estimate.spentTime
                    }
                }
            }
            const data = {
                'workitemIdentifier': identifier,
                'spentTime': spentTime,
                'type': type,
                'description': '',
                'recordUserIdentifier': user,
                'forCreate': false
            }
            await main.tool.request('https://devops.aliyun.com/projex/api/workitem/workitem/time/estimate?_input_charset=utf-8', data)

            return currentSpentTime + spentTime
        }

        getWorkitemDifficultyField(workitemType) {
            const map = {
                'ba102e46bc6a8483d9b7f25c': '9a3f2e26c257c5479feb90cfe3',
                '6da89f380532e4150d86c0fa20': '7e35bea0c49d65c25b916d72b9',
                '947683bf07275cddf056e9ba89': '2fe569f8d4eb0417586def0fa6',
                '3e016c7251aa4ba67e7ce16d58': '853f98c9810bf3f5191e12634e',
            }
            if (typeof map[workitemType] == 'undefined') {
                return ''
            }
            return map[workitemType]
        }

