        async getUser(tags = null) {
            const projectMatch = /\/project\/([0-9a-z]+)\//.exec(location.href)
            const projectId = projectMatch[1]
            let data = main.tool.localStorageGet('zhx-aliyun-user:' + projectId)
            if (data === null) {
                const roleList = await main.tool.requestGet('https://devops.aliyun.com/projex/api/workspace/role/list?targetType=Space&targetIdentifier=' + projectId + '&withUserDivision=true&_input_charset=utf-8')
                data = {}
                for (const role of roleList) {
                    data[role.role.displayName] = []
                    for (const user of role.users) {
                        data[role.role.displayName].push({
                            name:user.displayName,
                            id: user.identifier
                        })
                    }
                }
                main.tool.localStorageSet('zhx-aliyun-user:' + projectId, data, 86400)
            }
            if (typeof tags === 'string') {
                return data[tags] ??= []
            } else if (Array.isArray(tags)) {
                let newData = []
                for (let tag of tags) {
                    newData = [...newData, ...(data[tag] ??= [])]
                }
                return newData
            }
            return data
        }

